customDistanceMaterial.fragmentShader:
#define DISTANCE

uniform vec3 referencePosition;
uniform float nearDistance;
uniform float farDistance;
varying vec3 vWorldPosition;

#include <common>



// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/param1
uniform vec3 v_POLY_param1_val;

// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/param_selectedId
uniform float v_POLY_param_selectedId_val;

// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/attribute1
varying float varying_v_POLY_attribute1_val;




#include <packing>
#include <uv_pars_fragment>
#include <map_pars_fragment>
#include <alphamap_pars_fragment>
#include <clipping_planes_pars_fragment>

void main () {

	#include <clipping_planes_fragment>

	vec4 diffuseColor = vec4( 1.0 );



	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/attribute1
	float v_POLY_attribute1_val = varying_v_POLY_attribute1_val;

	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/round1
	float v_POLY_round1_val = sign(v_POLY_attribute1_val)*floor(abs(v_POLY_attribute1_val)+0.5);

	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/round2
	float v_POLY_round2_val = sign(v_POLY_param_selectedId_val)*floor(abs(v_POLY_param_selectedId_val)+0.5);

	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/compare1
	bool v_POLY_compare1_val = (v_POLY_round1_val == v_POLY_round2_val);

	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/twoWaySwitch1
	float v_POLY_twoWaySwitch1_val;
	if(v_POLY_compare1_val){
	v_POLY_twoWaySwitch1_val = 1.0;
	} else {
	v_POLY_twoWaySwitch1_val = 0.0;
	}

	// /MAT/meshBasicBuilder_MAT_SELECTION_HIGHLIGHT/output1
	diffuseColor.xyz = v_POLY_param1_val;
	diffuseColor.a = v_POLY_twoWaySwitch1_val;




	#include <map_fragment>
	#include <alphamap_fragment>
	#include <alphatest_fragment>

	float dist = length( vWorldPosition - referencePosition );
	dist = ( dist - nearDistance ) / ( farDistance - nearDistance );
	dist = saturate( dist ); // clamp to [ 0, 1 ]

	gl_FragColor = packDepthToRGBA( dist );

}

